import React from "react";
import styles from "../../styles/styles";
const Header = () => {
  return (
    <div className={`${styles.section}`}>
      <div className="hidden 800px:h-[50px] 800px:my-[20px] 800px:flex items-center justify-between"></div>
    </div>
  );
};

export default Header;
